import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Home = () => {
  const navigate = useNavigate();
  const { user } = useAuth();

  return (
    <div style={styles.container}>
      <main style={styles.main}>
        <div className="card" onClick={() => navigate('/events')}>
          <h2>Browse Events</h2>
          <p>Explore upcoming events with details like date, venue, and rules.</p>
          <button>View Events</button>
        </div>

        <div className="card" onClick={() => navigate('/my-registrations')}>
          <h2>My Registrations</h2>
          <p>Check the events you have registered for and manage participation.</p>
          <button>View Registrations</button>
        </div>

        <div className="card" onClick={() => navigate('/profile')}>
          <h2>Profile</h2>
          <p>Update your account information and keep details up to date.</p>
          <button>Go to Profile</button>
        </div>

        <div className="card" onClick={() => navigate('/contact')}>
          <h2>Help & Support</h2>
          <p>Need assistance? Contact the support team anytime.</p>
          <button>Contact Us</button>
        </div>
      </main>
    </div>
  );
};

const styles = {
  container: {
    flex: 1,
    padding: '40px',
  },
  main: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
    gap: '25px',
  }
};

export default Home;
